import React, { useRef, useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Autoplay } from "swiper";
import 'swiper/css';
import 'swiper/css/pagination';
import TourData from "./tourdata";

import './Tourhome.css'

const Tourhome = (props) => {
    return (
        <>
          
          <div className='trtitle'>
            <span>{props.Title}</span>
                    <Swiper
                        spaceBetween={30}
                        autoplay={{
                            delay: 1500,
                            disableOnInteraction: false,
                        }}
                       
                        modules={[Autoplay]}
                        className="mySwiper"
                    >
                      
                        <SwiperSlide>
                            
           
          
          
                            <p>Mehrangarh Fort is one of the largest forts in the country. It is located at the top of a 410 feet elevated hill and guarded by huge walls. The fort encloses a museum now which exhibits various belongings of the royals. 
                                The palace was built by Rao Jodha in 1459.</p>
                            <img src={props.Img1} alt="image" />
                            
                            </SwiperSlide>
                        <SwiperSlide>
                        <p>Mehrangarh Fort is one of the largest forts in the country. It is located at the top of a 410 feet elevated hill and guarded by huge walls. The fort encloses a museum now which exhibits various belongings of the royals. 
                                The palace was built by Rao Jodha in 1459.</p>
                            <img src={props.Img2} alt="" /></SwiperSlide>
                       
                       
                    </Swiper>
                  
                    </div>
              
        </>
    )
}

export default Tourhome
